export default function App() {
  const [value, setValue] = useState(10)

  const resizeToZero = () => {
    console.log('clicked the button')
    setValue(0)
  }

  return (
    <div>
      {value}
      <button onClick={resizeToZero}>reset to zero</button>
    </div>
  )
}
